query:
query SearchSlots($locationIds: [String!], $practitionerIds: [String!], $specialty: String, $serviceTypeTokens: [String!]!, $startAfter: String!, $startBefore: String!, $visitType: VisitType) {
  searchSlots(locationIds: $locationIds, practitionerIds: $practitionerIds, specialty: $specialty, serviceTypeTokens: $serviceTypeTokens, startAfter: $startAfter, startBefore: $startBefore, visitType: $visitType) {
    location {
      reference
      resource {
        ... on Location {
          id
          name
          address {
            line
            city
            state
            postalCode
            __typename
          }
          telecom {
            system
            value
            __typename
          }
          timezone
          managingOrganization {
            reference
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    practitionerAvailability {
      isTelehealth
      practitioner {
        reference
        resource {
          ... on Practitioner {
            id
            name {
              text
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      availability {
        id
        start
        end
        status
        serviceType {
          text
          coding {
            code
            system
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
